import React from 'react';
import './styles.css';
import UserRegistration from './components/UserRegistration';
import BicycleRegistration from './components/BicycleRegistration';
import TransactionRegistration from './components/TransactionRegistration';

const App = () => {
  return (
    <div className="app">
      <header>
        <h1>Bike Rental Management</h1>
        <img src="https://via.placeholder.com/800x200?text=Bike+Rental+System" alt="Bicycle" className="banner" />
      </header>
      <main>
        <UserRegistration />
        <BicycleRegistration />
        <TransactionRegistration />
      </main>
    </div>
  );
};

export default App;
